    the result of an amendment not being filed for the 12 day pre-general report.  This
    occurred due to a personnel change around that period.  In our working copy of
    the software the 12 day pre-general shows an A1 was prepared.  After receipt of
    the April 17th letter requesting a response, we printed the report and determined
    it had not been sent as the amended box was not marked.  This problem has been
    corrected and subsequent reports have also been amended in accordance with the
    letter received."
